INSERT INTO `mdl_scale` VALUES (1,0,0,'独立型和情景型学习方式','极端独立型,独立型与情景型兼备,极端情景型','此评级基于独立型和情景型认知理论。此理论描述了我们了解和评价所闻所见事物的两种不同方法。<ul><li><strong>独立型的人</strong>总是尽量保持客观，避免受感觉和情绪的影响。在与其他人讨论时，他们喜欢维护自己的观点，用逻辑找出对手观点中的漏洞。</li><li><strong>情景型的人</strong>比其他人更敏感。 他们善于换位思考，喜欢倾听和提问，直到他们觉得自己能从别人的角度理解事物。他们通过分享自己的经验，来从他人获得知识。</li></ul>',0,1537880294),(2,0,0,'默认能力等级','尚无该能力,具备该能力','除了某人是否已经表现出熟练程度以外，二进制评分表不提供进一步的信息。',0,1537880294);
/*!40000 ALTER TABLE `mdl_scale` ENABLE KEYS */;
